import { useLocation } from 'react-router-dom';
import back from './coin-back.svg';
import front from './coin-front.svg';
import coinSide from './coin-side.svg';
import './Game.css';

function Game() {
    const location = useLocation()
    const { name, bet, side } = location.state;

    console.log(name, bet, side);

    return (
        <div>
            <img className="coin-flip" id="coin-back" width={500} height={500} src={back} alt="coin" />
            <img className="coin-flip" id="coin-front" width={500} height={500} src={front} alt="coin" />
            <img className="coin-flip" id="coin-side" width={500} height={50} src={coinSide} alt="coin" />
        </div>
    );
}

export default Game;
